import React from 'react'
import { Label, Pie, PieChart, Tooltip } from 'recharts'
import Gender from './Gender';
<label >Male</label>
function Genderchart() {
   
  {
    const data = [
      {name: "Male",value:13,fill:"grey"},
      {name:"Female",value:10,fill:"maroon"},
      {name:"Required",value:5,fill:"orange"},
    ];
    return(
      <div className='chart'>
    <h1>Genderchart</h1>
    <div>
    <center><PieChart width={400} height={500}id='piechart' >
  <Pie 
    dataKey="value"
    data={data} 
    innerRadius={110}
    outerRadius={170}
    fill='orange'
    />
    <Tooltip/>
    </PieChart></center></div>
      </div>
      
    )
   
  }
}


export default Genderchart
